import dining1 from "./images/dining1.jpg";
import dining2 from "./images/dining2.jpg";
import dining3 from "./images/dining3.jpg";
import dining4 from "./images/dining4.webp";

let data_product = [
  {
    id: 1,
    name: "Interior design for dining room is not that complicated to do",
    image: dining1,
    new_price: 50000,
    old_price: 80000,
  },
  {
    id: 2,
    name: "Interior design for dining room is not that complicated to do",
    image: dining2,
    new_price: 85000,
    old_price: 120000,
  },
  {
    id: 3,
    name: "Interior design for dining room is not that complicated to do",
    image: dining3,
    new_price: 60000,
    old_price: 100000,
  },
  {
    id: 4,
    name: "Interior design for dining room is not that complicated to do",
    image: dining4,
    new_price: 100000,
    old_price: 150000,
  },
];

export default data_product;
